script: |
  super -f text -I q5410.spq | sort > q5410.out

inputs:
  - name: q5410.spq
    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) WHERE NOT + + col0 IN ( + 62, - col1 + - col0 * + 26 + 35 * 26 + + 32 * - col0 );
  - name: tab2

outputs:
  - name: q5410.out
    data: |
      46	51	23
      64	77	40
      75	67	58
